caption.text:
Seseorang ahli nada berkata pada sebuah gitar listrik tua,kita harus menciptakan sebuah gelombang nada yang berfrekuensi abadi,di petiknya senar dari gitar tua dengan sangat lihai,namun pada sebuah gelombang nada tunggal dia berhenti memainkan gitar nya. "Ah,rasanya tak ada gelombang sakti yang bisa di rasakan hati jika aku bermain sendiri"dia menerka hati kecilnya.

Lalu dia mulai membuka pintu rumahnya beranjak dengan gitar tua itu dan menjelajahi kota,kota itu bernama tasikmalaya,dia banyak bertemu dengan para ahli lain nya,seperti ahli tulis,ahli lukis,ahli menggambar dengan cahaya dan banyak ahli-ahli di tiap gang.

Tanpa banyak bicara mereka berkumpul pada sebuah pohon dengan keahlian nya masing-masing,rupanya panggilan hati telah mengalirkan glombang frekuensi yang di aliri medan magnet di tiap rasa  cinta dari mereka.

Dan benar saja pada satu nada serempak mereka telah menciptakan frekuensi karya abadi dan menjadi sejarah peresembahan untuk negara nya.

Semua para ahli di atas adalah komunitas yang berbuat untuk mempersembahkan rasa cinta terhadap kota tasikmalaya untuk indonesia bahkan dunia.

Semoga mata anak muda di tasikmalaya tidak tertidur dan terbuka lebar .mari mulai melakukan pergerakan wahai para ahli.

