DENYUT PROKLAMASI

Dari balik pengeras suara, teriakan seorang bapak bergetar. Didenyutkan jantung harapannya yang hampir seabad terpendam. Anak-anak berduyun-duyun dari segala penjuru mata nusantara. Mereka mendekat ke pusat suara, "Kalian lahir untuk menyangga kaki ibu pertiwi yang telah berusia 72 tahun," sambil turun panggung, ia berpesan dengan nafas berat.

