SATU FREKUENSI

Tujuh puluh dua tahun yang lalu, seorang Panglima membuka belantara untuk melukis jejak di atas tanah warisan para raja.

Tujuh puluh dua tahun kemudian, sebuah kampung halaman yang menjadi jantung rindu, denyutnya tidak pernah berhenti. Terus berdetak seperti jarum jam di dinding dada pemuda-pemudi harapan. Menjadi pengingat untuk berada pada rotasi yang tetap terjaga dalam perbuatan.

Mereka mengangkat tandu beramai-ramai yang di dalamnya terdapat sebuah kendi dengan petuah abadi "Demi kehormatan dwiwarna, seluruh pengorbanan terbesar diberikan dengan sukarela". Pada suatu malam, mereka berjalan di atas tanah mutiara. Berbondong-bondong untuk berkumpul di sebuah istana dengan langit-langitnya berwajah matahari.

